using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Web;
using System.Web.Mvc;
using iTextSharp.text;
using iTextSharp.text.html.simpleparser;
using iTextSharp.text.pdf;

namespace Base64ToPDF.Controllers
{
    public class HomeController : Controller
    {
        public ActionResult Index()
        {
            var str =
                "";
             Byte[] bytes = Convert.FromBase64String(str);

            string path = Server.MapPath("Models");
            var fileName = DateTime.Now.ToString("yyyyMMdd") + ".pdf";
            var fullPath = path + "\\" + fileName;
            //Using iTextSharp nuget
            using (MemoryStream ms = new MemoryStream())
            {
                
                Document document = new Document(PageSize.A4, 10f, 10f, 10f, 0f);
                PdfWriter.GetInstance(document, new FileStream(fullPath, FileMode.Create));
                document.Open();
                byte[] imageBytes = bytes;
                ms.Write(bytes, 0, bytes.Length);
                Image image = Image.GetInstance(imageBytes);
                if (image.Height > image.Width)
                {
                    float percentage = 0.0f;
                    percentage = 700 / image.Height;
                    image.ScalePercent(percentage * 100);
                }
                else
                {

                    float percentage = 0.0f;
                    percentage = 140 / image.Width;
                    image.ScalePercent(percentage * 100);
                }

                if (!document.IsOpen())
                {

                    document.Open();
                }
                document.Add(image);
                var htmlWorker = new HTMLWorker(document);

                bytes = ms.ToArray();
                document.Close();
            }
            Response.ContentType = "application/pdf";
         
            Response.AddHeader("Content-Disposition", "attachment; filename=" + fileName);
            Response.TransmitFile(fullPath);
            Response.Buffer = true;
            Response.Cache.SetCacheability(HttpCacheability.NoCache);
            Response.BinaryWrite(bytes);
            Response.End();
            Response.Close();
            Response.Flush();



            return View();
        }

        public ActionResult About()
        {
            ViewBag.Message = "Your application description page.";

            return View();
        }

        public ActionResult Contact()
        {
            ViewBag.Message = "Your contact page.";

            return View();
        }
    }
}
